import React from "react";
import CableGrid from "./CableGrid";
import CableDialog from "./CableDialog";

function Cable() {
  return (
    <>
      <h1>Stap 1: Selecteer een kabel</h1>
      <CableDialog />
      <CableGrid />
    </>
  );
}

export default Cable;
